export default (function(a,b,c,d,e,f,g,h,i){return {data:{UXmSrwA4xs:{data:{id:624,attributes:{imdbId:"tt6666218",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTkxOTc2ODgtZjRkNC00NjY3LWE4MTktNDRjNTQ0MTkxNGZhXkEyXkFqcGdeQXVyNjk2NjIzMDI@._V1_SX300.jpg",type:"series",ratings:[{Source:"Internet Movie Database",Value:"8.2\u002F10"}],item_lang:{data:{id:1287,attributes:{title:"Circle",plot:"A Sci-Fi-Mystery drama - episodes contain two shorter stories, the first half is set in 2017 called \"Beta Project,\" and the second half in 2037 called \"Grand New World.\" Aliens arrive on earth and humans take advantage of their knowledge and learn new skills from them, In the year 2037, humans emotions are controlled and regulated. The story centers on two brothers in both 'Beta Project' and 'Grand New World' as they try and figure out the mystery that surrounds them and find needed answers.",slug:"circle"}}},books:{data:[{id:4289,attributes:{title:d,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:e,subtitle:b}},{id:4290,attributes:{title:d,description:"When Mae Holland is hired to work for the world's most powerful internet company, she can't believe her luck. The Circle, run out of a hip, sprawling California campus, links users' online data with their universal operating system, creating a new age of civility and transparency. But the story of one woman's ambition and idealism soon becomes a heart-racing novel of suspense, raising questions about memory, history, privacy, and democracy, and the limits of human knowledge.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eXaRvgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:i,publisher:"Alfred A. Knopf",subtitle:"A Novel"}},{id:4291,attributes:{title:d,description:f,thumbnail:g,authors:[a],firstBook:c,published:h,publisher:e,subtitle:b}},{id:4292,attributes:{title:"Der Circle : Roman",description:"Huxleys ”Schöne neue Welt“ reloaded: Die 24-jährige Mae Holland ist überglück-lich. Sie hat einen Job ergattert in der hippsten Firma der Welt, beim ”Circle“, einem freundlichen Internetkonzern mit Sitz in Kalifornien, der die Geschäftsfelder von Google, Apple, Facebook und Twitter geschluckt hat, indem er alle Kunden mit einer einzigen Internetidentität ausstattet, über die einfach alles abgewickelt werden kann. Mit dem Wegfall der Anonymität im Netz - so ein Ziel der ”drei Weisen“, die den Konzern leiten - wird es keinen Schmutz mehr geben im Internet und auch keine Kriminalität. Mae stürzt sich voller Begeisterung in diese schöne neue Welt mit ihren lichtdurchfluteten Büros und High-Class-Restaurants, wo Sterneköche kostenlose Mahlzeiten für die Mitarbeiter kreieren, wo internationale Popstars Gratis-Konzerte geben und fast jeden Abend coole Partys gefeiert werden. Sie wird zur Vorzeigemitarbeiterin und treibt den Wahn, alles müsse transparent sein, auf die Spitze. Doch eine Begegnung mit einem mysteriösen Kollegen ändert alles ... Mit seinem neuen Roman ”Der Circle“ hat Dave Eggers ein packendes Buch über eine bestürzend nahe Zukunft geschrieben, einen Thriller, der uns ganz neu über die Bedeutung von Privatsphäre, Demokratie und Öffentlichkeit nachden-ken und den Wunsch aufkommen lässt, die Welt und das Netz mögen uns bitte manchmal vergessen.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=asD1oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:i,publisher:b,subtitle:b}},{id:4293,attributes:{title:"The Every",description:"From the award-winning, bestselling author of The Circle comes an exciting new follow-up. When the world’s largest search engine\u002Fsocial media company, the Circle, merges with the planet’s dominant ecommerce site, it creates the richest and most dangerous—and, oddly enough, most beloved—monopoly ever known: the Every. Delaney Wells is an unlikely new hire at the Every. A former forest ranger and unwavering tech skeptic, she charms her way into an entry-level job with one goal in mind: to take down the company from within. With her compatriot, the not-at-all-ambitious Wes Makazian, they look for the Every's weaknesses, hoping to free humanity from all-encompassing surveillance and the emoji-driven infantilization of the species. But does anyone want what Delaney is fighting to save? Does humanity truly want to be free? Studded with unforgettable characters, outrageous outfits, and lacerating set-pieces, this companion to The Circle blends absurdity and terror, satire and suspense, while keeping the reader in apprehensive excitement about the fate of the company—and the human animal.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hbAeEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2021-11-16",publisher:e,subtitle:"A novel"}}]}}},meta:{}}},prerenderedAt:1680940901778}}("Dave Eggers","",null,"The Circle","Vintage","A bestselling dystopian novel that tackles surveillance, privacy and the frightening intrusions of technology in our lives—a “compulsively readable parable for the 21st century” (Vanity Fair). When Mae Holland is hired to work for the Circle, the world’s most powerful internet company, she feels she’s been given the opportunity of a lifetime. The Circle, run out of a sprawling California campus, links users’ personal emails, social media, banking, and purchasing with their universal operating system, resulting in one online identity and a new age of civility and transparency. As Mae tours the open-plan office spaces, the towering glass dining facilities, the cozy dorms for those who spend nights at work, she is thrilled with the company’s modernity and activity. There are parties that last through the night, there are famous musicians playing on the lawn, there are athletic activities and clubs and brunches, and even an aquarium of rare fish retrieved from the Marianas Trench by the CEO. Mae can’t believe her luck, her great fortune to work for the most influential company in the world—even as life beyond the campus grows distant, even as a strange encounter with a colleague leaves her shaken, even as her role at the Circle becomes increasingly public. What begins as the captivating story of one woman’s ambition and idealism soon becomes a heart-racing novel of suspense, raising questions about memory, history, privacy, democracy, and the limits of human knowledge.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sbxWAAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2013-10-08","2014-01-01"))